function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
        </header>

          <button class="gradient-border">View Work</button>
          <button class="gradient-border">About Me</button>
      </div>
    </Router>

  );
}

export default App;
